import { HomeOutlined, UploadOutlined, UserOutlined, VideoCameraOutlined } from '@ant-design/icons';
import { Layout, Menu, theme } from 'antd';
import React from 'react';

import { Link, Outlet } from 'react-router-dom';

const { Header, Content, Footer, Sider } = Layout;

const Main = () => {
  const { token: { colorBgContainer } } = theme.useToken();

  return (
    <Layout style={{ height: '100svh' }}>
      <Layout>
        <Sider
          width='15%'
          breakpoint="lg"
          collapsedWidth="0"
        >
          {/* <Link to='/'>Home</Link> */}
          {/* <div className="demo-logo-vertical" /> */}
          <Menu
            // theme="dark"
            mode="inline"
            defaultSelectedKeys={['4']}
            items={[HomeOutlined].map(
              (icon, index) => ({
                key: String(index + 1),
                icon: <Link to='/'>{React.createElement(icon)}</Link>,
                label: 'Home',
              }),
            )}
          />
        </Sider>
        <Layout>
          <Header style={{ height: '10svh', padding: 0, background: colorBgContainer }} />
          <Content style={{ overflow: 'initial' }}>
            <div style={{ height: '73svh' }}>
              <Outlet />
            </div>
          </Content>
        </Layout>
      </Layout>
      <Footer style={{ height: '10svh', textAlign: 'center', backgroundColor: colorBgContainer }}>
        Ant Design Â©2023 Created by Ant UED
      </Footer>
    </Layout>
  );
};

export default Main;
